con:config.script:
//Get the sku by property expansion
def sku = context.expand ('${CreateNewProduct#Request#//*:sku}')

//Print the sku
log.info "SKU is $sku"

if (sku !="SKU00124"){
	log.info "Please do not Delete !"
	testRunner.gotoStepByName("DeleteProductBySKU")
}
else{
//Execute the next steps as normal

log.info "Search Product By SKU"

}

con:configuration.scriptText:
import com.eviware.soapui.support.XmlHolder
def response = context.testCase.getTestStepByName('CreateNewProduct').getPropertyValue("response")
def holder = new XmlHolder(response)
def varSKU = holder.getNodeValue("//*:sku")
context.testCase.setPropertyValue("propSKU",varSKU)

